import * as React from 'react';
import { Card, CardContent, CardMedia, Typography } from '@mui/material';

function Order({ order = {} }) {
  const { userName, address, cart = [], orderSum } = order;

  return (
    <Card sx={{ maxWidth: 345, margin: 2 }}>
      <CardContent>
        <Typography variant="h6" component="div">
          {userName || "Unknown User"}
        </Typography>

        <Typography variant="body2" color="text.secondary">
          Address: {address || "No address provided"}
        </Typography>

        {cart.length > 0 ? (
          cart.flat().map((item, index) => (
            <Card key={index} sx={{ display: 'flex', marginTop: 2 }}>
              {item?.p?.imgUrl && (
                <CardMedia
                  component="img"
                  sx={{ width: 151 }}
                  image={item.p.imgUrl}
                  alt={item.p.name}
                />
              )}
              <CardContent>
                <Typography component="div" variant="h6">
                  {item?.p?.name || "No name"}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {item?.p?.description || "No description"}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  Quantity: {item?.quantity ?? "N/A"}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  Price: {item?.p?.price ?? 0} ₪
                </Typography>
              </CardContent>
            </Card>
          ))
        ) : (
          <Typography variant="body2" color="text.secondary">
            No items in cart
          </Typography>
        )}

        <Typography variant="body2" color="text.secondary">
          Pay: {orderSum ?? 0} ₪
        </Typography>
      </CardContent>
    </Card>
  );
}

export default Order;
